@elements

Quote "Svar till "knorpi" den som laggt upp torrenten seedar bara en eller ett par."

Fatter inte riktigt va' du mener ? Seedar han eller inte ? Skit med det, om den kommer så kommer den...och om den inte blir seedad, så är det ju bara en mer vi inte får. Jag tror nog den kommer (men jeg är också optimist). :-)
